resources.string:
If check,
1, when the layout of the list is listed, the width of the list item is automatically set to the width of the list display area;
2, when the layout of the list is a one-way, the height of the list item is automatically set to the height of the display area.
3. When the list layout is horizontal and the column number is set, the width of the list items in each row is automatically
  adjusted so that the width of the row is equal to the width of the list display area;
4, the list of layout for the vertical flow, and set up a number of rows, each row of the project to automatically
  adjust the height for high and is equal to the height of the regional list;
5. When then list layout is pagination, the 3 and 4 rules apply.
